import React from 'react';

import './CalculatorSummary.css';

const calculatorSummary = (props) => {
    return (
        <div className="summary">
            <center><h1>Summary for the month {props.workedMonthName}</h1>
                <br></br>
                Time dimension on this date: <b>{props.workingHoursInMonth}</b>h, working hours: {props.workedHours}h<br></br>
                Hourly rate (gross): <b></b>{props.hourlyFee}zł<br></br>
                Number of overtime hours: <b></b>{props.overHoursAmount}, gross salary: {props.overHoursGrossIncome}zł<br></br>
                Number of overtime hours: <b></b>{props.overHoursAmount}, net salary: <b></b>{props.overHoursNetIncome}zł<br></br>
                Total gross salary (base + overhours): <b></b>{props.totalGrossIncome}zł<br></br>
                Total net salary (base + overhours): <b></b>{props.totalNetIncome}zł<br></br><br></br>
                <button className="buttonSummary" onClick={props.handleCloseSummary}>Hide</button>
            </center>
        </div>
    );
}

export default calculatorSummary;
